import React, {Component} from "react"; 
import "./About.css";
import {DiReact, DiJsBadge, DiHtml5, DiCss3, DiJqueryLogo} from "react-icons/di"


class About extends Component {
    render(){
        return (
            <div className="About">
                <h1 className="About-title">About Me</h1>
                <p className="About-paragraph">Hello! I am JP Luncumilla, a certified web developer graduate at the Full Stack Web Development Program in The University of Miami. My front end skills consist of:</p>
                <p className="About-icons"> <DiHtml5 /> <DiReact /> <DiJsBadge /> <DiCss3 /> <DiJqueryLogo /></p>
                <p className="About-paragraph">Outside of my programming skills I have prior experience in hospitality that includes managerial experience working in a shared workspace in a start up enviroment as well as luxury hotels.</p>
            </div>
        )
    }
};

export default About;
